import React, { Component } from 'react';
import { Provider as StyletronProvider, DebugEngine } from "styletron-react";
import { Client as Styletron } from "styletron-engine-atomic";
import { Div, StyleReset, ThemeProvider, Button, Text, Container, Section, Icon } from "atomize";


class Connect extends React.Component {

    render() { 
        return (
            <Div 
                d="flex" 
                justify="center" 
                align="center" 
                minH="100vh" 
                w="100vw" 
                flexDir="column"
            >
                <Text 
                    textSize="display2" 
                    textWeight="600"
                    textAlign="center"
                    m={{ b: "2rem" }}
                >
                Welcome to Dumb Donuts
                </Text>
                <Button 
                h="2.5rem"
                w="2.5rem"
                hoverBg="gray800"
                bg="black900"
                rounded="circle"
                m={{ l: "2rem" }}
                shadow="2"
                hoverShadow="4">Connect</Button>
            </Div>
            )
    }
}

export default Connect;
